	add("medusa", "{\"term\":\"medusa\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027ŒºŒ≠Œ¥ŒøœÖœÉŒ±\u0027 from \u0027ŒºŒ≠Œ¥œâ\u0027 (rule over)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The only mortal of the three gorgon sisters. She is killed by Perseus. The other two sisters were Euryale and Stheno\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1895\u0027\u0027, (editor and translator), \u0027Masterpieces of Greek Sculpture: A Series of Essays on the History of Art\u0027, 2010, ISBN 9781108017121, [http://books.google.com/books?id\u003dGlV3M3snWscC\u0026amp;pg\u003dPA201\u0026amp;dq\u003dmedusa+perseus\u0026amp;hl\u003den\u0026amp;ei\u003dhXIDTu6qMertmAWIpu2GDg\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d7\u0026amp;ved\u003d0CEoQ6AEwBjg\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dmedusa%20perseus\u0026amp;f\u003dfalse page 201\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"On an Attic vase of the middle of the fifth century the head of \u0027\u0027Medusa\u0027\u0027 in the hand of Perseus is represented as that of a beautiful woman free from any distortion. This led us to conclude (\u0027supra\u0027, p. 158) that \u0027\u0027Medusa\u0027\u0027 must have been so represented at Athens in the greater arts even previous to this vase, for the vase-painters never invent such bold novelties for themselves\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Nann√≥ Marinatos, \u0027The Goddess and the Warrior: The Naked Goddess and Mistress of the Animals in Early Greek Religion\u0027, [http://books.google.com/books?id\u003djwP8yhpyUkkC\u0026amp;pg\u003dPA62\u0026amp;dq\u003dmedusa+perseus\u0026amp;hl\u003den\u0026amp;ei\u003dEHsDTuX8OcrqmAXExuT2DQ\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d6\u0026amp;ved\u003d0CEcQ6AEwBTg\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dmedusa%20perseus\u0026amp;f\u003dfalse page 62\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"It will be suggested here that the myth of Perseus, involving the decapitation of \u0027\u0027Medusa\u0027\u0027, is a narrative version of ritual\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Dennis Berthold, \u0027Melville\u0027s \u0027\u0027Medusas\u0027\u0027\u0027, in Sanford E. Marovitz, Athanasios C. Christodoulou (editors), \u0027Melville \u0026quot;Among the nations\u0026quot;: Proceedings of an International Conference, Volos, Greece, July 2-6, 1997\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"But their depictions of Perseus are remarkably different and demonstrate the ambiguity of \u0027\u0027Medusa\u0027\u0027 that was seeping into Victorian iconography. In later, Roman versions of the myth, for example Ovid\u0027s \u0027Metamorphoses\u0027, Perseus slays the sea monster with his sword instead of using \u0027\u0027Medusa\u0027\u0027‚Äôs head to petrify the monster\", \"priority\":9}]}, \"synonyms\":{}}");

